import React, { Fragment } from "react";
import "./App.css";
import store from "./store";
import { Provider } from "react-redux";
import Companies from "./components/companies/Companies";

const App = () => {
  return (
    <Provider store={store}>
      <Fragment>
        <div className='App'>
          <h1>Hello World!</h1>
        </div>
        <Companies />
      </Fragment>
    </Provider>
  );
};

export default App;
